import Header from "../comp/Header";
import Footer from "../comp/Footer";


 const portfilo = ()=>{
  const [user, loading, error] = useAuthState(auth);
  const navigate = useNavigate();
  useEffect(() => {
  if(!user){
    navigate("/");
  }
  
  },[user]);
  return (
    <>
    <Header />
    <main>
      <p>name:</p>
      <p>email:</p>
      <p>DATE DE  CREATION DE COMPTE :</p>
    </main>
    <Footer />
    </>
    );
};



export default portfilo;
